  const OnSubmit = async (event) => {
    event.preventDefault();

  };

  return (<div>
    <form onSubmit={onSubmit}>
      <div className="form-group">
        <label> Title </label>
        <input 
        value={title} 
        onChange={(e) => setTitle(e.target.value)} 
        className="form-control" /> 
      </div>
      <button className="btn btn-primary">Submit</button>
    </form> 
  </div>);
};

